CREATE TABLE categories (
    category_id INTEGER PRIMARY KEY,
    category_name VARCHAR(50),
    description VARCHAR(255)
);



 CREATE TABLE customers (
    customer_id VARCHAR(5) PRIMARY KEY,
    company_name VARCHAR(50),
    contact_name VARCHAR(30),
    contact_title VARCHAR(30),
    address VARCHAR(100),
    city VARCHAR(50),
    region VARCHAR(50),
    postal_code VARCHAR(10),
    country VARCHAR(50),
    phone VARCHAR(20),
    fax VARCHAR(20)
);


CREATE TABLE employees (
    employee_id SERIAL PRIMARY KEY,
    last_name VARCHAR(255),
    first_name VARCHAR(255),
    title VARCHAR(255),
    title_of_courtesy VARCHAR(255),
    birth_date DATE,
    hire_date DATE,
    address VARCHAR(255),
    city VARCHAR(255),
    region VARCHAR(255),
    postal_code VARCHAR(10),
    country VARCHAR(255),
    home_phone VARCHAR(20),
    extension INTEGER,
    report_to INTEGER
);

-- Insert data into the employees table


-- Create the regions table
CREATE TABLE regions (
    region_id INTEGER PRIMARY KEY,
    region_description VARCHAR(50)
);

-- Insert data into the regions table

CREATE TABLE territory (
    territory_id VARCHAR(5) PRIMARY KEY,
    territory_description VARCHAR(50),
    region_id INTEGER,
    FOREIGN KEY (region_id) REFERENCES regions(region_id)
);

-- Insert data into the territory table

CREATE TABLE employee_territories (
    employee_id INTEGER,
    territory_id VARCHAR(10),
    FOREIGN KEY (employee_id) REFERENCES employees(employee_id),
    FOREIGN KEY (territory_id) REFERENCES territory(territory_id)
);

-- Insert data into the employee_territories table

CREATE TABLE suppliers (
    supplier_id INTEGER PRIMARY KEY,
    company_name VARCHAR(100),
    contact_name VARCHAR(100),
    contact_title VARCHAR(100),
    address VARCHAR(100),
    city VARCHAR(100),
    region VARCHAR(100),
    postal_code VARCHAR(20),
    country VARCHAR(100),
    phone VARCHAR(20),
    fax VARCHAR(20),
    homepage VARCHAR(255)
);

-- Insert data into the suppliers table

-- Create table
CREATE TABLE shippers (
    shipper_id INTEGER PRIMARY KEY,
    company_name VARCHAR(255),
    phone VARCHAR(20)
);

-- Insert data

CREATE TABLE products 
(
    product_id SERIAL PRIMARY KEY,
    product_name VARCHAR(255) NOT NULL,
    supplier_id INTEGER REFERENCES suppliers(supplier_id),
    category_id INTEGER REFERENCES categories(category_id),
    quantity_per_unit VARCHAR(50),
    unit_price NUMERIC(10, 2) NOT NULL,
    units_in_stock SMALLINT,
    units_on_order SMALLINT,
    reorder_level SMALLINT,
    discontinued SMALLINT NOT NULL
);

-- Insert data

CREATE TABLE orders (
    order_id SERIAL PRIMARY KEY,
    customer_id VARCHAR(10) REFERENCES customers(customer_id),
    employee_id INTEGER REFERENCES employees(employee_id),
    order_date DATE,
    required_date DATE,
    shipped_date DATE,
    ship_via INTEGER REFERENCES shippers(shipper_id),
    freight NUMERIC(10, 2),
    ship_name VARCHAR(255),
    ship_address VARCHAR(255),
    ship_city VARCHAR(255),
    ship_region VARCHAR(255),
    ship_postal_code VARCHAR(20),
    ship_country VARCHAR(255)
);

